import logo from '../images/logo.svg';
import '../App.css';
import './About.css';

export default function About() {
  return (
    <div className="container">
      <header className="App-header">
        <div>
          <div className="title aboutTitle">
            <p>Where is here?</p>
            <h1>Such <br/><span>Experimental</span></h1>
            <p className="intro">Hi, I'm Cathy, UI UX Designer in Toronto. Since 2014, I started my professional career and designed digital products like mobile apps and websites with my bare hands.</p>
            <p>Charisma +10 <br />Luck +10 <br />Happiness +15</p>
          </div>
        </div>
      </header>
    </div>
  );
}
